import React from "react";

const Card = ({ product }) => {
  return (
    <div style={{ width: "30%" }}>
      <div className=" flex justify-center items-center  h-2/4">
        <img
          style={{ width: "300px", height: "300px", objectFit: "contain" }}
          loading="lazy"
          src={product.url_image}
          alt=""
        />
      </div>
      <div className=" h-2/4">
        <h1 className=" text-2xl font-[Helvetica Neue]">{product.nombre}</h1>
      </div>
    </div>
  );
};

export default Card;
